declare const SQL_QUERY = "\nCREATE TABLE IF NOT EXISTS Returns (\n  \"party\" TEXT NOT NULL DEFAULT 'U' CHECK(`party` in ('D', 'R', 'G', 'L', 'OL', 'OC', 'OU', 'NPP', 'U')),\n  \"rank\" INTEGER NOT NULL,\n  \"tally\" INTEGER NOT NULL,\n  \"contestId\" TEXT NOT NULL REFERENCES Contest(id) ON UPDATE CASCADE ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED,\n  \"turfId\" TEXT NOT NULL REFERENCES Turf(id) ON UPDATE CASCADE ON DELETE CASCADE DEFERRABLE INITIALLY DEFERRED,\n  CONSTRAINT ReturnsPk PRIMARY KEY (\"contestId\", \"turfId\", \"party\", \"rank\")\n) WITHOUT ROWID;\n\n";
export default SQL_QUERY;
